	public int lengthOfLongestSubstring(String s) {
		if(s == null) {
			return -1;
		}
		
		int start = 0;
		int result = 0;
		boolean[] flag = new boolean[1000];
		char[] arr = s.toCharArray();
		
		for(int i = 0; i < arr.length; i++) {
			char current = arr[i];
			boolean exist = flag[current];
			if(exist) {
				result = Math.max(result, i - start);
				for(int k = start; k < i; k++) {
					char c = arr[k];
					if(c != current) {
						flag[c] = false;
					} else {
						start = k + 1;
						break;
					}
				}
			} else {
				flag[current] = true;
			}
		}
		
		return result;
	}
